=Score the relevance of the following trends for a social media campaign with the given brand voice and audience mood (1-10, where 10 is most relevant). Each trend must be scored exactly as provided, without splitting, modifying, or omitting any trends. You must return a score for every trend listed below:

Trends:
{{ $json.trends.map(item => `- "${item.name}"`).join("\n") }}

- Brand Voice: {{ $json.brand_voice }}
- Audience Mood: {{ $json.audience_mood }}

Return a JSON array in the format: [{"trend": "Trend 1", "score": 8}, {"trend": "Trend 2", "score": 5}]. The array must include exactly one entry for each trend listed above, with the trend name exactly matching the input (including all punctuation and spacing).

parameters.jsCode:
// Map over the items array to extract title and score from each item's json
const redditTrends = items.map(item => ({
  title: item.json.title,
  score: item.json.score || item.json.ups || 0
}));

// Return the mapped data as a single item
return [{ json: { reddit_trends: redditTrends } }];

// Ensure all fields are arrays, with a fallback to an empty array if undefined
const tweets = Array.isArray(items[0].json.tweets) ? items[0].json.tweets : [];
const redditTrends = Array.isArray(items[0].json.reddit_trends) ? items[0].json.reddit_trends : [];
const googleTrends = Array.isArray(items[0].json.google_trends) ? items[0].json.google_trends : [];
const twitterMentions = Array.isArray(items[0].json.twitter_mentions) ? items[0].json.twitter_mentions : [];

// Combine all trends into a single array
const allTrends = tweets.concat(redditTrends, googleTrends, twitterMentions);

// Map to a consistent format: {name: "..."}
const trends = allTrends.map(item => ({
  name: item.name || item.title || item.query || item.text || "Unknown Trend"
}));

// Determine brand_voice based on audience_mood or set a default
let brandVoice = "professional"; // Default brand voice
const audienceMood = items[0].json.audience_mood || "neutral";
if (audienceMood === "excited") {
  brandVoice = "playful"; // Example: Map "excited" mood to a "playful" voice
} else if (audienceMood === "negative") {
  brandVoice = "empathetic";
}

// Return the combined data, preserving other fields
return [{
  json: {
    trends: trends,
    news_sentiment: items[0].json.news_sentiment || "neutral",
    audience_mood: audienceMood,
    translated_tweets: items[0].json.translated_tweets || "",
    brand_voice: brandVoice
  }
}];

const trendScores = items[0].json.trend_scores || [];
const topTrend = trendScores.length > 0
  ? trendScores.reduce((max, item) => item.score > max.score ? item : max, trendScores[0])
  : { trend: "No trend available", score: 0 };

return [{
  json: {
    selected_idea: topTrend.trend,
    brand_voice: items[0].json.brand_voice || "professional",
    audience_mood: items[0].json.audience_mood || "neutral"
  }
}];

// 1. First, let's properly access the nested trends data
const messageContent = items[0]?.json?.message?.content || {};
const scoredTrends = messageContent.trends || [];

// 2. Debug output - check the execution data tab in n8n for these
console.log("Full input item:", JSON.stringify(items[0], null, 2));
console.log("Extracted trends:", JSON.stringify(scoredTrends, null, 2));

// 3. Process the trends we found
if (scoredTrends.length > 0) {
  return [{
    json: {
      trend_scores: scoredTrends.map(t => ({
        trend: t.trend || "Unnamed trend",
        score: typeof t.score === "number" ? t.score : 5
      }))
    }
  }];
}

// 4. Final fallback if no trends found
return [{
  json: {
    trend_scores: [{
      trend: "No trends available", 
      score: 5
    }]
  }
}];

// Simplify audience_mood to a single word or short phrase
let audienceMood = items[0].json.audience_mood || "neutral";
if (audienceMood.includes("excited")) {
  audienceMood = "excited";
} else if (audienceMood.includes("joyous")) {
  audienceMood = "joyous";
} else {
  audienceMood = "neutral";
}

// Return the modified data with a default brand_voice
return [{
  json: {
    trends: items[0].json.trends || [],
    audience_mood: audienceMood,
    brand_voice: items[0].json.brand_voice || "professional", // Default to "professional"
    news_sentiment: items[0].json.news_sentiment || "neutral",
    translated_tweets: items[0].json.translated_tweets || ""
  }
}];

// Get the OpenAI response
let content;
if (items[0]?.json?.message?.content) {
  content = items[0].json.message.content;
} else if (items[0]?.json?.content) {
  content = items[0].json.content;
} else {
  console.error("Unexpected OpenAI response structure:", items[0]);
  content = "{}"; // Fallback to empty JSON
}

// Parse the response as JSON if it's a string
let parsedContent;
if (typeof content === "string") {
  try {
    parsedContent = JSON.parse(content);
  } catch (error) {
    console.error("Failed to parse OpenAI response:", content);
    // Fallback to default content if parsing fails
    parsedContent = {
      twitter: "Could not generate content for Twitter/X. #Fallback",
      linkedin: "Could not generate content for LinkedIn. Please try again later.",
      tiktok: "Could not generate TikTok script. #Fallback",
      youtube_shorts: "Could not generate YouTube Shorts script. #Fallback"
    };
  }
} else {
  parsedContent = content;
}

// Ensure the response has the expected fields
if (!parsedContent.twitter || !parsedContent.linkedin || !parsedContent.tiktok || !parsedContent.youtube_shorts) {
  console.error("OpenAI response missing required fields:", parsedContent);
  parsedContent = {
    twitter: parsedContent.twitter || "Could not generate content for Twitter/X. #Fallback",
    linkedin: parsedContent.linkedin || "Could not generate content for LinkedIn. Please try again later.",
    tiktok: parsedContent.tiktok || "Could not generate TikTok script. #Fallback",
    youtube_shorts: parsedContent.youtube_shorts || "Could not generate YouTube Shorts script. #Fallback"
  };
}

// Return the parsed content
return [{ json: parsedContent }];

const sheetData = items[0].json;
const trends = sheetData.Trend.split("; ");
const scores = sheetData.Score.split("; ").map(Number);

const trendScores = trends.map((trend, index) => ({
  trend: trend,
  score: scores[index] || 5
}));

return [{
  json: {
    trend_scores: trendScores,
    brand_voice: sheetData.BrandVoice || "professional",
    audience_mood: sheetData.AudienceMood || "neutral"
  }
}];

